- новости о последних изменениях в законодательстве, касающихся работы бухгалтерии;
- информацию о том, как эти изменения будут отражаться в программных продуктах фирмы "1С";
- материалы о событиях, так или иначе касающихся использования программ "1С";
- сведения о проектах наиболее важных документов в сфере бухучета и налогообложения
